import React from "react";
import "./style.css";

function FriendCard(props) {
  return (
    <div className=" center">
      <div className="content">
        <ul>
          <li>
            <strong>Name:</strong> {props.name}
          </li>
          <li>
            <strong>Description:</strong> {props.description}
          </li>
        </ul>
      </div>
    </div>
  );
}

export default FriendCard;
